import styled from 'styled-components';

const Box = styled.div`
  width: 55vw;
  display: flex;
  background: linear-gradient(
    to right,
    ${props => props.theme.body} 50%,
    ${props => props.theme.text} 50% bottom,
  );
`

const Intro = () => {
    return (
        <Box>
            Introduction
        </Box>
    )
}

export default Intro;
